export interface IndexDBItem {
    /**
     * Key Path，AutoIncrease
     */
    id?: number;
}
export interface ZegoLog extends IndexDBItem {
    id: number;
    /**
     * 日志内容，就是实际上报的报文内容
     */
    log: string;
    instanceId: number;
}
export interface LoggerInstance extends IndexDBItem {
    id: number;
    appId: number;
    userIds: string[];
    active: number;
    lastLogTime: number;
    createdAt: number;
    logQuantity: number;
    byteLength: number;
    lastUploadInfo?: {
        logId: number;
        usageId: number;
    };
}
export interface FileUsage extends IndexDBItem {
    id: number;
    fileId: number;
    byteLength: number;
    startTime: number;
    lastTime: number;
}
